    function viewfun() public view returns(uint){
        return age;
    }

    function purefun() public pure returns (uint){
        return 1;
    }

    function purefun2(uint _x) public pure returns (uint){
        return _x;
    }

    function simfun() public  {
        age+=10;
    }

    

